import { Avatar, Col, Image, List, Row, Space, Tag, Typography } from 'antd';
import React from 'react';
import { API_KEY } from '../../constants/api-keys';

function CurrentlyPlayingList({ current }) {
	const { Title, Text } = Typography;
	const imgUrl = API_KEY.IMAGE_URL;
	console.log(current);

	return (
		<List
			itemLayout='horizontal'
			size='large'
			dataSource={current}
			renderItem={(item) => (
				<List.Item>
					<Row gutter={[16]}>
						<Col>
							<Avatar
								shape='square'
								size={200}
								src={`${imgUrl + item.poster_path}`}
							/>
						</Col>

						<Col>
							<Title level={2}>{item.title}</Title>
							<Space>
								<Text>Release date:</Text>
								<Tag color='purple'>{item.release_date}</Tag>
							</Space>
						</Col>
					</Row>
				</List.Item>
			)}
		/>
	);
}

export default CurrentlyPlayingList;
